import { LegacyRef } from "react";
import { View, StyleSheet, createElement, TextInput } from "react-native";

const dotCSSInfo = {
  width: 10,
  height: 10,
  unit: "px",
};

const inputTypePasswordCSSInfo = {
  width: 200,
  height: 100,
  unit: "px",
};

const AuroraPasswordInputComponent = () => {
  const attachShadow = (host: View): LegacyRef<View> | undefined => {
    return undefined;
  };
  // return <View ref={attachShadow} style={styles.membrane}></View>;
  return (
    <View ref={attachShadow} style={styles.membrane}>
      <TextInput style={styles.input_type_password} />
    </View>
  );
};

const styles = StyleSheet.create({
  membrane: {
    height: 100,
    width: 200,
    borderWidth: 1,
    borderColor: "#111",
    borderStyle: "solid",
  },
  input_type_password: {
    width: inputTypePasswordCSSInfo.width,
    height: inputTypePasswordCSSInfo.height,
    position: "relative",
    color: "transparent",
  },
});

export default AuroraPasswordInputComponent;
